import './App.css';

class App extends Component {
  render() {
    const name = "ALAN";

    return(
      <div className = "App">
        <h1>The App Component</h1>
        <h4>Hello {name.toLowerCase()}.</h4>
      </div>
    );
  }
}

export default App;
